import Header from "./Header";
import SliceZone from "./components/SliceZone";
import Head from "next/head";
import { Client } from "../prismic-configuration";
import { RichText } from "prismic-reactjs";
import { Container, Row } from "react-bootstrap";

const Index = ({ home, header }) => {
  //Tests
  const banner = home.data;
  const quote = home.data.body[0].primary;
  const nav = header.data;
  console.log(home);
  console.log(header);
  console.log(banner);
  console.log(quote);

  return (
    <>
      <Header header={nav} />
      <Container className="page-container">
        <Head>
          <title>{RichText.asText(banner.page_title)}</title>
        </Head>

        <Row>
          {RichText.asText(banner.title)}
          <br />
          {RichText.asText(banner.text)}
          <br />
          {RichText.asText(banner.button_label)}
        </Row>

        <SliceZone slices={home.data.body} />
      </Container>
    </>
  );
};

export async function getStaticProps() {
  const client = Client();
  const home = await client.getSingle("home");
  const header = await client.getSingle("header");

  return {
    props: {
      home: home,
      header,
    },
  };
}

export default Index;
